export default function Registerscreen() {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setconfirmPassword] = useState('');
    

  return (
    <div>
      <div className="row justify-content-center mt-5">
        <div className="col-md-5">
            <h2 style={{fontSize:'30px'}} className='text-center'>Welcome</h2>
          <div>
            <input required type="text" placeholder="name" className="form-control"  value={name} onChange={(e)=>setName(e.target.value)}/>
            <input type="text" placeholder="email" className="form-control" value={email} onChange={(e)=>setEmail(e.target.value)} />
            <input type="text" placeholder="password" className="form-control" value={pasword} onChange={(e)=>setPassword(e.target.value)}/>
            <input type="text" placeholder="confirm password" className="form-control" value={confirmPassword} onChange={(e)=>setconfirmPassword(e.target.value)}/>
            <button className="btn mt-3">Register</button>
          </div>
        </div>
      </div>
    </div>
  );
}
